 import {useState, useEffect} from 'react'
 import SearchBar from './SearchBar';
 const [products, setProducts] = useState([])
 useEffect(() => {
   setTimeout(() => {
     setProducts = [
      'tooth paste',
      'tooth brush',
      'mouth wash',
      'mouth guard'
  ]
   }, 3000)

 }, [])
 function App() {

  return (
    <div className="todo-pp" >
      <SearchBar products={products} />


    </div>
  );
}

export default App;
